INSERT INTO `movie` (`MovieID`, `Title`, `DescriptionShort`, `DescriptionLong`, `Runtime`, `ReleaseDate`, `Foto`, `Status`, `IMDBLink`) VALUES
	(67, 'green book', 'A working-class Italian-American bouncer becomes the driver of an African-American classical pianist on a tour of venues through the 1960s American South.', '', '120', '2018-01-01 00:00:00', 1, 'active', NULL),
	(68, 'gladiator', 'A former Roman General sets out to exact vengeance against the corrupt emperor who murdered his family and sent him into slavery.', 'Maximus is a powerful Roman general, loved by the people and the aging Emperor, Marcus Aurelius. Before his death, the Emperor chooses Maximus to be his heir over his own son, Commodus, and a power struggle leaves Maximus and his family condemned to death. The powerful general is unable to save his family, and his loss of will allows him to get captured and put into the Gladiator games until he dies. The only desire that fuels him now is the chance to rise to the top so that he will be able to look into the eyes of the man who will feel his revenge.', '120', '2000-01-27 00:00:00', 2, 'active', NULL),
